import LoginImg from "../asset/1.svg";

const Login = () => {
  return (
    <div>
      <div>
        <img src={LoginImg} alt="" />
      </div>
      <div>
        <form action="">
          <label></label>
        </form>
      </div>
    </div>
  );
};

export default Login;
